import React from 'react';

const IncomingOrder = () => {
  const orders = [
    {
      id: 1,
      name: "John Doe",
      email: "johndoe@example.com",
      product: "Apple MacBook Pro 17\"",
      totalPrice: "$2999",
    },
    {
      id: 2,
      name: "Jane Smith",
      email: "janesmith@example.com",
      product: "Dell XPS 15",
      totalPrice: "$2499",
    },
    {
      id: 3,
      name: "Emily Johnson",
      email: "emilyj@example.com",
      product: "Lenovo ThinkPad X1",
      totalPrice: "$1999",
    },
    {
      id: 4,
      name: "Michael Brown",
      email: "michaelb@example.com",
      product: "HP Spectre x360",
      totalPrice: "$1599",
    },
    {
      id: 5,
      name: "Sarah Wilson",
      email: "sarahw@example.com",
      product: "Asus ZenBook 14",
      totalPrice: "$1399",
    },
  ];

  return (

    <div className=" overflow-x-auto shadow-md sm:rounded-lg">
      <table className="w-full text-sm text-left rtl:text-right text-gray-500 dark:text-gray-400">
        <thead className="text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-400">
          <tr>
            <th scope="col" className="px-6 py-3">ID</th>
            <th scope="col" className="px-6 py-3">Names</th>
            <th scope="col" className="px-6 py-3">Customer Email</th>
            <th scope="col" className="px-6 py-3">Product Name</th>
            <th scope="col" className="px-6 py-3">Total Price</th>
          </tr>
        </thead>
        <tbody>
          {orders.map((order) => (
            <tr key={order.id} className="bg-white border-b dark:bg-gray-800 dark:border-gray-700 hover:bg-gray-50 dark:hover:bg-gray-600">
              <td className="px-6 py-4">{order.id}</td>
              <td className="px-6 py-4">{order.name}</td>
              <td className="px-6 py-4">{order.email}</td>
              <td className="px-6 py-4">{order.product}</td>
              <td className="px-6 py-4">{order.totalPrice}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default IncomingOrder;
